import React from 'react';

import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import styles from './Aboutaone.module.css';
import Homes4 from '../Homes/Homes4';

const Home = () => {
  return (
    <div>
      <Top />
      <div className={styles.title}>연혁</div>
      <Homes4 />
      <Bottom />
    </div>
  );
};

export default Home;
